import React from 'react';

export default function Chart() {
    return (
        <div class="card bg-light mb-3">
            <div class="card-header">Chart Name</div>

            <div class="card-body">
                <p class="card-text">Chart Description</p>
            </div>
                
            <div className="d-flex">
                <button>Open</button>
                <button>Delete</button>
            </div>
        </div>
    );
}
